var $bm_rt;
var sin, i;
var fx = effect('Boom Swing');
var amp = fx(1);
var freq = fx(2);
var offset = fx(3);
var ease = fx(4);
var result = 0;
if (freq > 0) {
    offset = $bm_div($bm_div(offset, 100), freq);
    sin = Math.sin($bm_mul($bm_mul($bm_mul($bm_sum(time, offset), freq), 2), Math.PI));
    for (i = 0; i < ease; i++) {
        sin = Math.sin($bm_div($bm_mul(sin, Math.PI), 2));
    }
    result = $bm_mul(sin, amp);
}
$bm_rt = $bm_sum(result, value);

